import { Result } from './Result';
/**
 *  Return the inner `T` of a `Ok(T)`.
 *
 *  @throws {TypeError}
 *      Throws if the self is a `Err`.
 */
export declare function unwrapFromResult<T, E>(v: Result<T, E>): T | never;
/**
 *  Return the inner `E` of a `Err(E)`.
 *
 *  @throws {TypeError}
 *      Throws if the self is a `Ok`.
 */
export declare function unwrapErrFromResult<T, E>(v: Result<T, E>): E | never;
